exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.ibiquxs.com/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,[/<div id="list">\s*<dl>\s*(?<fragment>(?:\s*<dt>.+<\/dt>|\s*<dd>.+<\/dd>)+)/,/<dt>(?<since>《[^》]*》(?<volume>[^<]+))<\/dt>|<a href="(?<url>[^"]+)">(?<name>[^<]+)</g],{clientOptions:{...(options&&options.clientOptions)}})};